import logo from './logo.svg';
import './App.css';


function App() {

  const [post, setPost] = useState(null)

useEffect(()=>{
  fetch('http://localhost:5000/get')
    .then((response)=>response.json())
    .then((response)=>setPost({
      message: response.message,
      name: response.name,
      list:response.list

