    .catch((error)=>console.log(error))

},[])


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {!post? 'Error': post.message}
        </p>
        <div>
            {!post? 'Error': post.name}
        </div>
        <ul>
        {

          }
        </ul>

        {/* <div>{state.name}</div> */}
